import React, { Component } from 'react';
import PageTitle from '../components/h1';
import MainText from '../components/text';
import BoldText from '../components/boldText';
import Button from '../components/button';
import Coin from '../components/coin';

import '../index.css';

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>
          <BoldText label="Player" />
        </th>
        <th>
          <Coin classprop="game-stats-coin" />
        </th>
        <th>
          <BoldText label="Time" />
        </th>
        <th>
          <BoldText label="Date" />
        </th>
      </tr>
    </thead>
  );
};

const TableBody = (props) => {
  const rows = props.statsData.map((row, index) => {
    return (
      <tr key={index}>
        <td>
          <MainText label={row.player} />
        </td>
        <td>
          <MainText label={row.score} />
        </td>
        <td>
          <MainText label={row.time} />
        </td>
        <td>
          <MainText label={row.date} />
        </td>
      </tr>
    );
  });

  return <tbody>{rows}</tbody>;
};

class Table extends Component {
  render() {
    return (
      <div className="center-wrapper">
        <PageTitle label="StatsðŸ”®" />
        <table>
          <TableHeader />
          <TableBody statsData={this.props.statsData} />
        </table>
        <div className="congrats-settings-item">
          <Button label="Menu" />
        </div>
      </div>
    );
  }
}

export default Table;
